    ans = 1
    for x in range(A, B + 1):
        count = 0
        i = 1
        while i * i <= x:
            if x % i == 0:
                count += 1
                if x // i != i:
                    count += 1
                if count > N:
                    break
            i += 1
        if count == N:
            ans += 1
    return ans

